import React from 'react';
import styled from 'styled-components';

const ActivitiesDiv =styled.div`
    padding: 20px 32px;
    width:100px;
    height:100px;
    position:flex;
    background: white;
    border-radius:16px;
    
`;

const styledImg =styled.img`
    max-width:auto;
    height:auto;
`;

const Activities =({imgsrc,description})=>{
    return(
      <ActivitiesDiv >
          <styledImg src={imgsrc} />
          <p>{description}</p>
      </ActivitiesDiv>
    );
};
export default Activities;
